from Foxtrot.foxtrot import compare_datafrom Classes.store import BaseStore, Soupfrom utillities import HEADERS, get_article_from_title, clean_priceclass MoyoStore(BaseStore):    def __init__(self):        super().__init__(            shop_url='https://www.moyo.ua/ua/acsessor/acsessor_for_comp/manipulators/wacom/?page=1')        self.soup = Soup(MoyoStore.get(self,                                       shop_url='https://www.moyo.ua/ua/acsessor/acsessor_for_comp/manipulators/wacom/?page=1'))        self.all_items = self.soup.find_elements(class_='catalog_content').find(            class_='catalog_products js-products-list')    def generate_info_from_moyo(self):        if self.all_items:            for item in self.all_items.find_all('div', class_='product-card goods-item add-data ga-item'):                name = item.find('a', class_='product-card_title gtm-link-product').text                price = (item.find('div', class_='product-card_price_current').text.strip().replace(" ", "")                         .replace("â‚´", ""))                card_item = {                    'name': name,                    'price': clean_price(price),                    'article': get_article_from_title(name).strip()                }                self.item_list.append(card_item)        return self.item_listmoyo = MoyoStore()items = moyo.generate_info_from_moyo()# print(items)compare_data(items)## from bs4 import BeautifulSoup# import requests### response = requests.get(url='https://www.moyo.ua/ua/acsessor/acsessor_for_comp/manipulators/wacom/?page=1', headers=HEADERS)## soup = BeautifulSoup(response.text, 'lxml')## all = soup.find(class_='catalog_content').find(class_='catalog_products js-products-list')# for i in all.find_all('div', class_='product-card goods-item add-data ga-item'):#     print(i)